-- trigger để check ngày đặt phòng

DELIMITER $$ 
CREATE TRIGGER check_order_date
BEFORE INSERT ON DonDatPhong
FOR EACH ROW
BEGIN
IF NEW.NgayNhanPhong <= CURDATE() THEN
   SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'You cannot place an order in the past';
    END IF;
END $$
DELIMITER ;



-- trigger để check tuổi nhân viên 
DELIMITER $$
CREATE TRIGGER check_age_before_insert
BEFORE INSERT ON NhanVien
FOR EACH ROW
BEGIN
   IF TIMESTAMPDIFF(YEAR, NEW.NgaySinh, CURDATE()) <= 18 THEN
   SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Employee must be older than 18';
    END IF;
END $$
DELIMITER ;

-- Trigger Xóa các bản ghi khi CSVC bị xóa
DELIMITER $$

CREATE TRIGGER AfterDelete_CoSoVatChat
AFTER DELETE ON CoSoVatChatPhong
FOR EACH ROW
BEGIN
    DELETE FROM LichSuSuaChuaBaoDuong
    WHERE IDTienNghi_CoSoVatChat = OLD.ID;
END $$

DELIMITER ;

-- Trigger Check không được trùng tên TienNghiPhong
DELIMITER $$

CREATE TRIGGER BeforeInsert_TienNghiPhong
BEFORE INSERT ON TienNghiPhong
FOR EACH ROW
BEGIN
    DECLARE countTienNghi INT;
    SELECT COUNT(*) INTO countTienNghi 
    FROM TienNghiPhong 
    WHERE LOWER(Ten) = LOWER(NEW.Ten);

    IF countTienNghi > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Tên tiện nghi đã tồn tại!';
    END IF;
END $$

DELIMITER ;

DELIMITER $$

CREATE TRIGGER trg_before_update_phong
BEFORE UPDATE ON Phong
FOR EACH ROW
BEGIN
    -- Kiểm tra nhân viên dọn phòng
    IF NEW.IDNhanVienDonPhong IS NOT NULL THEN
        IF NOT EXISTS (
            SELECT 1
            FROM NhanVien
            WHERE ID = NEW.IDNhanVienDonPhong
              AND VaiTro = 'House Keeper'
        ) THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Nhân viên dọn phòng không hợp lệ';
        END IF;
    END IF;

    -- Kiểm tra nhân viên phòng
    IF NEW.IDNhanVienPhong IS NOT NULL THEN
        IF NOT EXISTS (
            SELECT 1
            FROM NhanVien
            WHERE ID = NEW.IDNhanVienPhong
              AND VaiTro = 'Room Employee'
        ) THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Nhân viên phòng không hợp lệ';
        END IF;
    END IF;
END $$

DELIMITER ;


